import React from 'react';

const SignupForm = () => {
  return (
    <div className="signup-form-container">
      <h2 className="signup-form-title">Let's get started<br />with a few simple steps</h2>
      <form className="signup-form">
        <label className="signup-label">Email</label>
        <input type="email" className="signup-input" />

        <label className="signup-label">FullName</label>
        <input type="text" className="signup-input" />

        <label className="signup-label">Password</label>
        <input type="password" className="signup-input" />

        <button type="submit" className="signup-btn">
          Sign up
        </button>
      </form>
      <p className="signup-terms">
        By signing up, you agree to our <a href="#" className="signup-link">Terms of Service</a>.<br />
        Already have an account? <a href="#" className="signup-link">Log in</a>
      </p>
    </div>
  );
};

export default SignupForm;
